import './App.css';
import {Button} from '@mui/material';
import Navbar from './Components/Navbar';

function App() {
  return (
    <div className="App">
      <Navbar/>
      <Div><h1>Cricket Live Score</h1></Div>


      <Button variant="contained" color="success">Click Here</Button>
      </div>
  );
}

export default App;
